import React from "react";
import "./Header.css";
import SearchIcon from "@material-ui/icons/Search";
import HeaderOption from "./HeaderOption";
import HomeIcon from "@material-ui/icons/Home";
import SupervisorAccountIcon from "@material-ui/icons/SupervisorAccount";
import BusinessCenterIcon from "@material-ui/icons/BusinessCenter";
import ChatIcon from "@material-ui/icons/Chat";
import NotificationsIcon from "@material-ui/icons/Notifications";

function Header() {
  return (
    <div className="header">
      <div className="header_left">
        <img
          src="https://content.linkedin.com/content/dam/me/business/en-us/amp/brand-site/v2/bg/LI-Bug.svg.original.svg"
          alt=""
        />
        <div className="header_search">
          <SearchIcon />
          <input type="text" />
        </div>
      </div>
      <div className="header_right">
        <HeaderOption Icon={HomeIcon} title="Home" />
        <HeaderOption Icon={SupervisorAccountIcon} title="My network" />
        <HeaderOption Icon={BusinessCenterIcon} title="Jobs" />
        <HeaderOption Icon={ChatIcon} title="Messaging" />
        <HeaderOption Icon={NotificationsIcon} title="Notification" />
        <HeaderOption avatar="https://scontent.fjsr4-1.fna.fbcdn.net/v/t1.0-0/p206x206/116906199_3139506436145375_4594349265725512189_o.jpg?_nc_cat=104&ccb=2&_nc_sid=da31f3&_nc_eui2=AeFpZb71eqVJJk8K0nEu-Pgc3F6CDQneyALcXoINCd7IAvVEG3W07phlGRax4_2CXv8HmM_77-syp3Qh1TxPUKK0&_nc_ohc=lQ-FxdKCE50AX_Yyojl&_nc_ht=scontent.fjsr4-1.fna&tp=6&oh=5d7c588a5036692e91af8576f1321256&oe=600AFF0C" />
      </div>
    </div>
  );
}

export default Header;
